■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>1日4球。約1ヶ月分!!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5046/6030be-01.jpg" width="600" height="659"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【製造者】<br>大阪市浪速区桜川4丁目11番4号<br>株式会社　緑応科学研究所<br><br>【名称】<br>プロポリスエキス加工食品<br><br>【目安量】<br>1日4球(約1ヶ月分)</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">アルテピリンCなどの貴重な有用成分を唯一含んでいるアレクリンやユーカリを起源植物とするプロポリスエキスを4球中300mg配合しました!!</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【4球(1.56g)あたり】<br>エネルギー(9kcal)、たんぱく質(0.49g)、脂質(0.68g)、炭水化物(0.28g)、ナトリウム(0.3mg)、ビタミンC(97mg)、ビタミンE(α-トコフェロール)(27mg)、パントテン酸(14mg)、ビタミンB1(1.37mg)、ビタミンB2(1.32mg)、ビタミンB6(1.10mg)、ビタミンB12(3μg)</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">プロポリスエキス(ブラジル産)、オリーブ油、しそ油、ビタミンE含有植物油、ゼラチン、グリセリン、ビタミンC、みつろう、グリセリン脂肪酸エステル、植物レシチン(大豆由来)、パントテン酸カルシウム、カラメル色素、V.B1、V.B2、V.B6、V.B12<br><br>※原材料の一部に、ゼラチン、大豆を含む</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">アルテピリンCなどの貴重な有用成分を唯一含んでいるアレクリンやユーカリを起源植物とするプロポリスエキスを4球中300mg配合しました!!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">390mg×120球</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">46×46×88mm</font><br><font color="#333333" size="-1">個装サイズ：6×6×10cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：164g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">【4球(1.56g)あたり】<br>アルテピリンC…15.6mg<br>p-クマル酸…3.4mg<br>スーパーオキシド消去活性(SOD)…34400単位　<br><br>試験依頼先:財団法人日本食品分析センター、試験成績書発行番号:第09034278001-01号</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">賞味期間：製造日より720日<br>商品区分:健康食品<br>名称:プロポリスエキス加工食品<br>保存方法：品質保持の為、高温・多湿及び直射日光を避け冷暗所に保存してください。</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
