■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>ブラジル直輸入!!栄養豊富な天然プロポリス。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5222/3785bq-01.jpg" width="393" height="500"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【召し上がり方】<br>1日にスポイトで1mlを目安に、水またはジュースなどに混ぜてお召し上がりください。<br>(お召し上がりになる前によく振ってください)<br><br>【ご注意】<br>●乳幼児の手の届かないところに置いてください。<br>●食物アレルギーのある方、薬を服用したり通院中の方は、お召し上がりになる前にお医者様とご相談ください。<br>●食品のため衛生的な環境でお取扱いください。<br>●本品は原材料の性質上、外観に多少の違いが生じる場合がございます。<br>●組み立て式のスポイトを添付しています。<br>開栓後は、スポイトをビンにセットしてご使用ください。<br><br>【販売者】<br>株式会社エーエフシー<br>静岡市駿河区豊田2-4-3</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">各種ビタミンやミネラル、アミノ酸などを豊富に含有。ミツバチが作った天然のプロポリス原液を便利なスポイトタイプの容器に入れました。</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">(100mlあたり)エネルギー:586kcal、たんぱく質:0.5g、脂質:21g、炭水化物:6g、ナトリウム:1mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">ブラジル産プロポリス原液(エタノール抽出)</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">各種ビタミンやミネラル、アミノ酸などを豊富に含有。ミツバチが作った天然のプロポリス原液を便利なスポイトタイプの容器に入れました。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">30ml(約1ヶ月分)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：4×4×11cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：80g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品<br>賞味期間：製造日より720日<br>保存方法：高温多湿および直射日光を避け、涼しい所に保存してください。</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">ブラジル</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
