商品名：Ｂｅ＊ｃｌｏｔｈ 布ナプキン　ライナー 紺 ドット<br>ブランド：Ｂｅ＊ｃｌｏｔｈ<br>原産国：日本<br><br>洗って使える、お肌と環境にやさしいナプキン<br>リバーシブルで使える超薄型のライナー。<br>軽い日やおりもの用として最適です。<br>下着感覚でご使用いただけます。<br><br>成分：<br>肌にふれる部分は綿１００％で無漂白・無着色です。<br><br>使用方法：<br>ご使用前に必ず洗ってください。<br>吸収・肌触りがよくなります。<br>ネル地を肌へ、柄側を下着側にして羽の部分でショーツをはさみスナップで固定します。<br><br>問合せ先：<br>株式会社ちのしお販売　<br>北九州市小倉北区京町１－２－２４　<br>０１２０－４４７－３８８<br><br>JANコード:4571243117085<br><br><br>商品番号：101-11862<br><br><br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
